    false,nt"url": null,nt"notes": "Reson 8101ER multibeam Data were collected
    between 16-17 September 2003 (JD 259-260) aboard NOAA Survey Launch Acoustic Habitat
    Investigator (AHI) at Rota Island in the Commonwealth of the Northern Mariana Islands
    in the Western Pacific during cruise OES-03-07/AHI-03-07. The AHI was deployed independently
    from the NOAA Ship Oscar Elton Sette (OES) during the cruise. The multibeam data
    were logged into data set Rota and collected using SAIC ISS-2000 software in the
    Generic Sensor Format and processed using SABER editing software. Sound velocity
    corrections from a Seabird SBE19 CTD sensor and motion corrections from a POS-MV
    vertical reference were applied to the data in real time. Observed tides from Guam
    tide gauge 1630000 were applied using SABER postprocessing software. Horizontal
    accuracy is 20m (no differential GPS correctors applied), vertical accuracy is depth
    dependent (~1% of water depth), WGS84 datum. These data are not to be used for navigation.
    Depths mapped range from ~ 10 - 300 m.",nt"license_title": null,nt"extras":
